import styled from 'styled-components';

export default Button = styled.button`
font-family: sans:serif;
font-size: 1.3rem;
border: none;
border-radius: 5px;
padding: 7px 10px;
background: red;
color: '#fff';
&:hover{
  background: blue;
}
`
